import React from 'react';
import logo from './logo.svg';
import './App.css';


function PostControlPanel() {
    return (
    <div>
      <button onClick={this.props.addPost}>Add Post</button>
      <button onClick={this.props.removePost}>Remove Post</button>
    </div>
    );
}

function App() {
  function addPost() { console.log("Add Post"); }
  function removePost() { console.log("Remove Post"); }
  return (
    <div className="App">
      <PostControlPanel addPost={addPost} removePost={this.removePost}/>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
